        super();
        this.state={
            isLoaded: false,
            images : []
        }
    }

    componentDidMount(){

        fetch('https://api.imgflip.com/get_memes')
        .then(res => res.json())
        .then(json => {
            this.setState({
                isLoaded:true,
                images: json.data.memes 
            })
        })
    }

    render() {
        console.log(this.state.images[0])
